import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { Provider } from 'react-redux';
import Routes from './Routes';

ReactDOM.render(
  <Provider>
    <Routes />
  </Provider>,
  document.getElementById('root'),
);

